import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="Rectangle">
        Carwale
       <img src={'images/carwalelogo.png'} width="30" height="30" />

      </div>
      <div className=".Rectangle-Copy-7">

        <a className=".Title-1" style={{ color: "blue" , width: "160px", height: "160px"}}>Colors      </a>
        <a className="btn btn-sm btn-outline-secondary" style={{ color: "blue" }}>Images    </a>
        <a className="btn btn-sm btn-outline-secondary" style={{ color: "blue" }}>Videos    </a>
        <a className="btn btn-sm btn-outline-secondary" style={{ color: "blue" }}>360 View    </a>


      </div>
    </div>



  );
}

export default App;
